import React from "react"
import styles from "../App.module.css";

interface Props {
	platforms: []
};

function PlatformIconList({ platforms }: Props) {
	return (
		<>
		{platforms.map(platform => (<p className={styles.platform} key={platform.platform}> {PlatformIconList(platform.platform)} {platform.platform}</p>))}
		</>
	);

}

export default PlatformIconList;
